#include <bits/stdc++.h>
#include <vector>
using namespace std;
vector<long long> pro;

int adj = 13;

string data = "";
int main() {
	for (int index=0; index<data.length()-adj-1; index++) {
		long long x=1;
		for (int i=index; i<adj+index; i++) {
			string ss(1,data[i]);
			x*=atoll(ss.c_str());
			if (x==0) {
				index+=12;
				break;
			}
			else cout<<i<<"\tINDEX\t"<<((i-index)%13)+1<<":\t"<<ss<<"\t"<<x<<endl;
		}
		if (x>0) pro.push_back(x);
	}
	sort(pro.begin(),pro.end());
	cout <<"HIGHEST "<<pro.at(pro.size()-1)<<endl;
	return 0;
}
